* {

}

body {

  color: #333;
  background-color: #f9f9f9;

}

.card-container {

  margin-top: 20px;

}

.card {
  background-color: #fff;
  border: 1px solid #ddd;
  border-radius: 8px;

  width: 40%;

  height: 400px;
  padding-top: 10%;
}

.card img {
  max-width: 120px;
  margin-bottom: 20px;
}

.card h2 {
  font-size: 1.5rem;
  margin-bottom: 10px;
  color: #2d064d;
}

.btn {
  display: inline-block;
  background-color: #ff4500;
  color: #fff;
  padding: 10px 15px;
  border-radius: 5px;
  text-decoration: none;
  font-size: 1rem;
  font-weight: bold;
  cursor: pointer;
  border: none;
}

.btn:hover {
  background-color: #e63e00;
}

  </style>
